  p: number | string;
  m: number | string;
  other?: string | number;
  onClick: () => string;
}

export const Button = (props: Props) => {
  const clickHandler = () => {
    console.log("Hi");
  };
  return (
    <button
      onClick={clickHandler}
      className={`bg-${props.bgBtn} m-${props.m}  p-${props.p} w-${props.width} font-${props.fontWeight} text-${props.color} text-${props.textSize}`}
    >
      {props.color}
    </button>
  );
};
